import { echartOptionProfixHandle, PublicConfigClass } from '@/packages/public'
import { PieDashboardConfig } from './index'
import { CreateComponentType } from '@/packages/index.d'
import cloneDeep from 'lodash/cloneDeep'
import dataJson from './data.json'

export const show = [
    {
        label: '是',
        value: true
    },
    {
        label: '否',
        value: false
    },
]
export const includes = []

const max = 100

export const option = {
    dataset: dataJson,
    angleAxis: {
        show: false,
        max: (max * 360) / 270, //-45度到225度，二者偏移值是270度除360度
        type: 'value',
        startAngle: 225, //极坐标初始角度
        splitLine: {
            show: false,
        },
    },
    barMaxWidth: 20, //圆环宽度
    radiusAxis: {
        show: false,
        type: 'category',
    },
    //圆环位置和大小
    polar: {
        center: ['50%', '50%'],
        radius: '120%',
    },
    series: [
        // 彩色1
        {
            type: 'bar',
            barGap: '-100%',
            coordinateSystem: 'polar',
            roundCap: true,
            radius: '55%',
            center: ['50%', '50%'],
            z: 3,
            label: {
                show: false,
            },
            labelLine: {
                show: false,
            },
            data: [
                {
                    value: dataJson,
                },
            ],
            color: [
                {
                    type: 'linear',
                    x: 1,
                    y: 0,
                    x2: 0,
                    y2: 0,
                    colorStops: [
                        {
                            offset: 0,
                            color: '#F4F5FD', // 0% 处的颜色
                        },
                        {
                            offset: 0.5,
                            color: '#AECFE9', // 50% 处的颜色
                        },
                        {
                            offset: 1,
                            color: '#7083DB', // 100% 处的颜色
                        },
                    ],
                },
            ],
        },
        // 白色2
        {
            type: 'pie',
            radius: '53%',
            center: ['50%', '50%'],
            avoidLabelOverlap: false,
            z: 4,
            hoverAnimation: false,
            label: {
                show: false,
            },
            labelLine: {
                show: false,
            },
            data: [
                {
                    value: 1,
                },
            ],
            itemStyle: {
                color: '#ffffff',
            },
        },
        // 浅蓝3
        {
            type: 'pie',
            radius: '65%',
            center: ['50%', '50%'],
            data: [
                {
                    //上层圆环，显示数据
                    value: dataJson,
                    itemStyle: {
                        color: 'rgba(112, 131, 219, 0.07)',
                    },
                },
            ],
            barGap: '-100%', //柱间距离,上下两层圆环重合
            roundCap: true, //顶端圆角
            z: 3, //圆环层级，同zindex
        },
        // 深蓝4
        {
            //下层圆环，显示最大值
            type: 'bar',
            data: [
                {
                    value: 100,
                    itemStyle: {
                        color: '#7083DB',
                        opacity: 0.1,
                        borderWidth: 0,
                    },
                },
            ],
            barGap: '-100%',
            coordinateSystem: 'polar',
            roundCap: true,
            z: 1,
        },
        // 仪表盘指针5
        {
            type: 'gauge',
            axisLine: {
                show: false,
            },
            splitLine: {
                show: false,
            },
            axisTick: {
                show: false,
            },
            axisLabel: {
                show: false,
            },
            splitLabel: {
                show: false,
            },
            pointer: {
                icon:
                    'image://data:image/png;base64,',
                length: 120,
                width: 120,
                offsetCenter: [0, '-45%'],
                itemStyle: {
                    color: 'auto',
                },
            },
            detail: {
                formatter: (params: any) => {
                    return '线索完成度\n' + params + '%';
                },
                color: '#404447',
                fontSize: 22,
                offsetCenter: [0, 10],
            },
            data: [
                {
                    value: dataJson,
                },
            ],
            z: 5,
        },
        //仪表盘外层刻度6
        {
            name: '外部刻度',
            type: 'gauge',
            //  center: ['20%', '50%'],
            radius: '75%',
            min: 0, //最小刻度
            max: 100, //最大刻度
            splitNumber: 10, //刻度数量
            startAngle: 225,
            endAngle: -45,
            axisLine: {
                show: true,
                lineStyle: {
                    width: 1,
                    color: [[1, 'rgba(0,0,0,0)']],
                },
            }, //仪表盘轴线
            axisLabel: {
                show: false,
                color: '#4d5bd1',
                distance: 25,
            }, //刻度标签。
            axisTick: {
                show: true,
                splitNumber: 7,
                lineStyle: {
                    color: '#7083DB', //用颜色渐变函数不起作用
                    opacity: 0.6,
                    width: 2,
                },
                length: -8,
            }, //刻度样式
            splitLine: {
                show: false,
                length: -20,
                lineStyle: {
                    color: '#C7CBCF', //用颜色渐变函数不起作用
                },
            }, //分隔线样式
            detail: {
                show: false,
            },
        },
    ],
}

export default class Config extends PublicConfigClass implements CreateComponentType {
    public key: string = PieDashboardConfig.key

    public chartConfig = cloneDeep(PieDashboardConfig)

    // 图表配置项
    public option = echartOptionProfixHandle(option, includes)
}
